sys_script_include.script:
var MathFP = (function() {
    var MathFP = function() {};
    var performSimpleOperation = function(operation, a, b) {
        switch (operation) {
            case 'add':
                return a + b;
            case 'subtract':
                return a - b;
            default:
                throw new Error(JasmineTestSetupConstantsFP.ERRORS.INVALID_OPERATION + ':  ' + operation);
        }
    };
    var square = function(a) {
        return Math.pow(a, 2);
    };

    MathFP.prototype = {
        PerformSimpleOperation: performSimpleOperation,
        Square: square,
    };
    return MathFP;
})();
